  config: {
    name: "rps",
    aliases: ["rockpaperscissors"],
    author: "TOKODORI",
    category: "game",
    shortDescription: { en: "Play Rock-Paper-Scissors", tl: "Maglaro ng Rock-Paper-Scissors" },
