    guide: { en: "{p}rps <choice>", tl: "{p}rps <piliin>" },
  },

  onStart: async function ({ event, message, args }) {
    const choices = ["rock", "paper", "scissors"];
    const userChoice = args[0]?.toLowerCase();

    if (!userChoice || !choices.includes(userChoice)) {
      message.reply("Please choose either rock, paper, or scissors.");
      return;
    }

    const botChoice = choices[Math.floor(Math.random() * choices.length)];

    if (userChoice === botChoice) {
      message.reply(`It's a tie! Both chose ${userChoice}.`);
    } else if (
      (userChoice === "rock" && botChoice === "scissors") ||
      (userChoice === "paper" && botChoice === "rock") ||
      (userChoice === "scissors" && botChoice === "paper")
    ) {
      message.reply(`Congratulations! You won. You chose ${userChoice} and I chose ${botChoice}.`);
    } else {
      message.reply(`You lost. You chose ${userChoice} and I chose ${botChoice}.`);
    }
  },
};

