const fetch = require('node-fetch');

module.exports = {
  config: {
    name: "replitstatus",
    author: "liane",
    version: "1.0.0",
    aliases: ["rs"],
    shortDescription: {
      en: "Check the status of Repl.it",
      tl: "Suriin ang status ng Repl.it"
    },
    longDescription: {
      en: "Check the current status of Repl.it and see if there are any ongoing issues or outages.",
      tl: "Suriin ang kasalukuyang status ng Repl.it at tingnan kung may mga problemang nagaganap o mga hindi magagamit na serbisyo."
    },
    category: "goatBot",
    guide: {
      en: "{p}replitstatus",
      tl: "{p}replitstatus"
    },
  },
  onStart: async function({ api, message }) {
    // Make an API request to get the Repl.it status
    const response = await fetch("https://status.replit.com/api/v1/status");
    const data = await response.json();

    // Check if there are any ongoing incidents or outages
    if (data.incidents.length > 0) {
      const ongoingIncidents = data.incidents.filter(incident => incident.status === "ongoing");

      // Send a message with the ongoing incidents
      if (ongoingIncidents.length > 0) {
        const incidentText = ongoingIncidents.map(incident => `- ${incident.name}`).join("\n");
        message.reply(`There are ongoing incidents on Repl.it:\n${incidentText}`);
      } else {
        message.reply("There are no ongoing incidents on Repl.it.");
      }
    } else {
      message.reply("Repl.it is currently operational. There are no ongoing incidents or outages.");
    }
  }
};

