    // Store the bot's start time
    global.GoatBot.startTime = moment();

    message.reply("Bot has started!");
  },
  run: async function ({ event, message }) {
    // Get the current uptime by calculating the difference between the current time and start time
    const uptime = moment.duration(moment() - global.GoatBot.startTime);

    // Format the uptime in a readable format
    const formattedUptime = `${uptime.days()} days, ${uptime.hours()} hours, ${uptime.minutes()} minutes, ${uptime.seconds()} seconds`;

    // Send the uptime as a message
    message.reply(`The bot's uptime is: ${formattedUptime}`);
  },
};

